import React, { Component } from 'react';
import { withCookies } from 'react-cookie';
import { Head } from '../Head';
import './index.css'
const { browseRequest } = require('../matcha_pb');

class Feed extends Component {
	constructor(props) {
		super(props);

		this.state = {
			user: {
				userID: 0,
				firstName: '',
			},
			users: []
		}
		this.readFeed = this.readFeed.bind(this)
	}

	readFeed = () => {
		console.log(`called`);
		const request = new browseRequest();
		const uid = this.props.cookies.get('uid');
		const temp = this.props.cookies.get('session_id');
		// request.setTagsList(['cat']);
		// request.setMaxage(20);
		const metaData = {
			'user_id': uid,
			'session_id': temp
		}
		const stream = window.Aclient.feed(request, metaData);
		stream.on('data', (response) => {
			console.log('b: ',this.state.user[0])
			console.log(response.array[0])
			console.log(response.array[1])
			// console.log(response);
			const user = {...this.state.user}
			user.userID = response.array[0];
			user.firstName = response.array[1];
			this.setState({user})
			this.state.users.push(user)
			console.log('a: ',this.state.users)
			console.log('a: ',this.state.users[0])
			console.log('a: ',this.state.users[1])

		});
		stream.on('error', function(err) {
			console.log(`error: ${err}`);
		});
	}

	componentDidMount() {
		this.readFeed()
	}

	render() {
		return (
			<div>
				<Head />
				<div className="feedmain">
					Hello, /{this.state.users}/
				</div>
			</div>
		)
	}
}

export default withCookies(Feed);
